import React from 'react';
import CardColumns from 'react-bootstrap/CardColumns';


import Cards from './Cards';

class Main extends React.Component {

  clickMe = (event) => {
    return
    this.props.showModalCard(event.target.value);
}
  render() {
    return (
      <CardColumns>
        <Cards elementData={this.props.mainData} showModalCard={this.clickMe}/>
      </CardColumns>
    );
  }
}
export default Main;
